The Seahawks racked up six sacks and held the 49ers to just 142 total yards in a dominating 20-3 win at Levi's Stadium. Marshawn Lynch rumbled for 122 yards and a touchdown for Seattle, which improved to 3-and-4.   19228209, "name" : "Bleacher Report - NFL", "description" : "Report - Videos - NFL", "slug" : "Bleacher-Report-NFL" } } 
Russell Wilson finished 18-of-24 for 235 yards, a TD and two interceptions. Colin Kaepernick was just 13-of-24 for 124 yards for the Niners, who slipped to 2-and-5. Carlos Hyde and Reggie Bush combined for just 61 rushing yards in the setback. 
